import React from 'react';
import ProjectCart from './ProjectCart/ProjectCart';
import s from './Projects.module.css';

const Projects = (props) => {

    let carts =
        props.carts.map(c => <ProjectCart header={c.header}
            description={c.description}
            projectLanguage={c.projectLanguage}
        />);

    return (
        <div id='projects' className={s.body}>
            <span id={s.projects_header}>Projects</span>
            {carts}
            <button id={s.more_projects}>MORE PROJECTS</button>
        </div>
    );
}

export default Projects;
